import axios from 'axios';

const API = {
    searchGoogle: function(input) {
        console.log(input);
        let queryString = 'https://www.googleapis.com/books/v1/volumes?key=AIzaSyAIY4R3KJo33zPFCjFeSoMxrFgHZBHiuw4&q=' + input;
        return axios.get(queryString);
    }
}

export default API;
